  var map = map_d6559d40b92eeed8a3869cc4aab9a0d7;
  var panel = document.getElementById("detail-panel");
  var header = document.getElementById("detail-panel-header");
  var detailDiv = document.getElementById("detail-content");
  var toggle = document.getElementById("detail-toggle");
  var openTableBtn = document.getElementById("open-table-btn");

  if (!panel || !header || !detailDiv || !toggle) {
    console.warn("detail-panel introuvable");
  }

  if (openTableBtn) {
    openTableBtn.addEventListener("click", function(e) {
      e.preventDefault();
      // même dossier : map.html <-> table.html
      window.open("table.html", "_blank");
    });
  }

  // Ajuster la hauteur de la carte à la fenêtre
  try {
    var container = map.getContainer();
    function resizeMap() {
      container.style.height = window.innerHeight + "px";
      map.invalidateSize();
    }
    resizeMap();
    window.addEventListener("resize", resizeMap);
  } catch (e) {
    console.warn("Impossible d'ajuster la hauteur de la carte :", e);
  }

  function showParcelle(pid) {
    if (!pid || !details[pid]) return;
    if (collapsed) setCollapsed(false);
    detailDiv.innerHTML = details[pid];
    if (centroids[pid] && map && map.setView) {
      map.setView([centroids[pid].lat, centroids[pid].lng], 18);
    }
  }

  function nearestParcelle(lat, lng) {
    var bestId = null;
    var bestD2 = Infinity;
    for (var pid in centroids) {
      if (!centroids.hasOwnProperty(pid)) continue;
      var c = centroids[pid];
      var dy = c.lat - lat;
      var dx = c.lng - lng;
      var d2 = dx*dx + dy*dy;
      if (d2 < bestD2) {
        bestD2 = d2;
        bestId = pid;
      }
    }
    return bestId;
  }

  var params = new URLSearchParams(window.location.search);
  var pid = params.get("parcelle");
  if (pid) {
    showParcelle(pid);
  }

  if (map && map.on) {
    map.on("click", function(e) {
      var lat = e.latlng.lat;
      var lng = e.latlng.lng;
      var pid2 = nearestParcelle(lat, lng);
      if (pid2) {
        showParcelle(pid2);
      }
    });
  }

  var collapsed = false;
  function setCollapsed(state) {
    collapsed = state;
    if (collapsed) {
      detailDiv.style.display = "none";
      toggle.textContent = "+";
    } else {
      detailDiv.style.display = "block";
      toggle.textContent = "−";
    }
  }
  setCollapsed(false);

  toggle.addEventListener("click", function(e) {
    e.stopPropagation();
    e.preventDefault();
    setCollapsed(!collapsed);
  });
  toggle.addEventListener("mousedown", function(e) {
    e.stopPropagation();
  });

  var dragging = false;
  var startX = 0, startY = 0;
  var startLeft = 0, startTop = 0;

  header.addEventListener("mousedown", function(e) {
    if (e.target === toggle) return;
    dragging = true;
    startX = e.clientX;
    startY = e.clientY;

    var rect = panel.getBoundingClientRect();
    startLeft = rect.left;
    startTop = rect.top;

    document.body.style.userSelect = "none";
  });

  document.addEventListener("mousemove", function(e) {
    if (!dragging) return;
    var dx = e.clientX - startX;
    var dy = e.clientY - startY;
    panel.style.left = (startLeft + dx) + "px";
    panel.style.top  = (startTop  + dy) + "px";
    panel.style.right = "auto";
  });

  document.addEventListener("mouseup", function(e) {
    if (!dragging) return;
    dragging = false;
    document.body.style.userSelect = "";
  });
});
</script>
